    700: {
      type: "TEXT_NODE",
      text: ", the learning curve has been insane! What I thought would take six months, I’ve learned in just two weeks. The pace is unreal. Here are my key takeaways as a founder:",
      isVisible: True,
    },
    701: {
      tagName: "br",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[2]/br",
      children: [],
      isVisible: False,
    },
    702: {
      tagName: "span",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[2]",
      children: ["701"],
      isVisible: False,
    },
    703: {
      tagName: "br",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[3]/br",
      children: [],
      isVisible: False,
    },
    704: {
      tagName: "span",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[3]",
      children: ["703"],
      isVisible: False,
    },
    705: {
      type: "TEXT_NODE",
      text: "➡️  The most obvious solutions are often the hardest to see. When solving a problem, your mind gets pulled into tangents. But once you find the solution, it feels glaringly obvious in hindsight. Take Instagram: when phones added cameras, they bet people would take photos and share them online. Obvious now, but not back then.",
      isVisible: True,
    },
    706: {
      tagName: "br",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[4]/br",
      children: [],
      isVisible: False,
    },
    707: {
      tagName: "span",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[4]",
      children: ["706"],
      isVisible: False,
    },
    708: {
      tagName: "br",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[5]/br",
      children: [],
      isVisible: False,
    },
    709: {
      tagName: "span",
      attributes: {},
      xpath:
        "html/body/div[6]/div[3]/div/div/div[2]/div/div/main/section[4]/div[4]/div/div/div/div[2]/section/div[2]/div/ul/li[2]/div/div/div/div/div/div/div/div[3]/div/div/div/span/span/span[5]",
      children: ["708"],
      isVisible: False,
    },
    710: {
      type: "TEXT_NODE",
      text: "➡️ All advice is nuanced. Early on, I’d take every word from successful founders as gospel, only to end up overwhelmed by conflicting opinions.\xa0Over time, I learned to filter and trust what felt right. The truth is, no single piece of advice will build a successful company - it’s about finding what works for you.",
      isVisible: True,
    },
    711: {
      type: "TEXT_NODE",
      text: "➡️ Fast today is slow tomorrow. As a team, we often made quick decisions to chase initial traction, only to realize later they were wrong. This applies to everything - even diet, exercise, and sleep. We’d spend 5-6 days coding 15 hours a day, only to burn out when the product didn’t work. Balance isn’t just important - it’s essential.",
      isVisible: False,
    },
    712: {
      type: "TEXT_NODE",
      text: "➡️ Filter bad ideas quickly. When we started YC, we were building something completely different than what we have now - and honestly, the same might be true 3 months from now. The key is to iterate fast, filter out bad ideas quickly, and train your mind to build, test, and scrap without hesitation.",
      isVisible: False,
    },
    713: {
      type: "TEXT_NODE",
      text: "➡️ Be attached to the problem, not the product. There will be times when you realize your product can’t solve a customer’s issue. But that shouldn’t stop you from pursuing that customer. We made this mistake early on, focusing too narrowly on what we were building and for whom - only to discover that the real problem was something we didn’t fully understand.",
      isVisible: False,
    },
    714: {
      type: "TEXT_NODE",
      text: "➡️ Find refuge in mentors. For us, it was our YC group partners. Share what’s on your mind - what’s keeping you up at night. If you’re tired, learn to rest, not to quit. Picture yourself 5 years from now and ask:\xa0Will I be proud of the decisions I’m making today?",
      isVisible: False,
    },
    715: {
      type: "TEXT_NODE",
      text: "If you’ve read this far, thank you.",
      isVisible: False,
    },
    716: {
      type: "TEXT_NODE",
      text: "Just to clarify, I haven’t figured things out if anything, I have more questions now than I did a month ago. Checkout",
      isVisible: False,
    },
    717: { type: "TEXT_NODE", text: "❤️", isVisible: False },
    718: {
      type: "TEXT_NODE",
      text: "As Paul Graham says, the best entrepreneurs don’t cling to a vision forever. They talk to their users daily, listen to their biggest problems, and constantly refine their product.",
      isVisible: False,
    },
